import {useState} from "react";
import "./App.css";

function App() {
  const [patienter, setPatienter] = useState([
    {id: 12345, plats: "101", datum: "23-09-30", fvk: "LEB"},
    {id: 67890, plats: "111", datum: "23-10-10", fvk: "MD"},
  ]);
  console.log(patienter);
  return (
    <div className="App">
      <h1>Teest</h1>
      <br />

      {/* tabell av patienter */}
      <table>
        <tr>
          <th>Plats</th>
          <th>Datum</th>
          <th>FVK</th>
        </tr>
        {patienter.map((p) => {
          return (
            <tr>
              <td>{p.plats}</td>
              <td>{p.datum}</td>
              <td>{p.fvk}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}

export default App;
